import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Define the Weather component
function Weather() {
  return (
    <div className="weather-container">
      <h1>Today's weather is:</h1>
      <Link to="/" className="back-button">Back to Main Page</Link>
    </div>
  );
}

function Report() {
  return (
    <div className="report-time-container">
      <h1>How many hours did you drive today?</h1>
      <div className="buttons-container">
        <Link to="/report/6hour" className="time-button">6 Hour</Link>
        <Link to="/report/8hour" className="time-button">8 Hour</Link>
        <Link to="/report/9hour" className="time-button">9 Hour</Link>
      </div>
    </div>
  );
}

// Component for reporting 6 hours with back button
function SixHourReport() {
  return (
    <div className="hour-report-container">
      <h1>You reported 6 hours of driving today.</h1>
      <Link to="/" className="back-button">Back to Main Page</Link>
    </div>
  );
}

// Component for reporting 8 hours with back button
function EightHourReport() {
  return (
    <div className="hour-report-container">
      <h1>You reported 8 hours of driving today.</h1>
      <Link to="/" className="back-button">Back to Main Page</Link>
    </div>
  );
}

// Component for reporting 9 hours with back button
function NineHourReport() {
  return (
    <div className="hour-report-container">
      <h1>You reported 9 hours of driving today.</h1>
      <Link to="/" className="back-button">Back to Main Page</Link>
    </div>
  );
}

function CommunityTips() {
  return (
    <div className="tips-container">
      <h1>Here are the links of some helpful information:</h1>
      <h2></h2>
      <h2></h2>
      <h2>https://newsinhealth.nih.gov/2020/06/safe-driving#:~:text=Always%20keep%20your%20eyes%20on,Drive%20at%20the%20speed%20limit</h2>
      <h2></h2>
      <h2>https://www.nationwide.com/lc/resources/auto-insurance/articles/driving-safety-tips</h2>
      <h2></h2>
      <h2>https://wisconsindot.gov/Pages/safety/education/safedriving.aspx</h2>

      <Link to="/" className="back-button">Back to Main Page</Link>
    </div>
  );
}



// Define the main App component
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={
          <div className="App">
            <header className="App-header">
              <h1>Welcome to Schneider Truck</h1>
            </header>
            <nav className="App-nav">
           <Link to="/destination" className="nav-button">Enter Your Destination</Link>
              <Link to="/report" className="nav-button">Report Time</Link>
              <Link to="/weather" className="nav-button">Weather Today</Link>
              <Link to="/about_us" className="nav-button">About US</Link>
              <Link to="/community_tips" className="nav-button">Community Tips</Link>
              <Link to="/driving_summary" className="nav-button">Driving Summary</Link>
              <Link to="/community_support" className="nav-button">Community Support</Link>
            </nav>
          </div>
        } />
        <Route path="/weather" element={<Weather />} />
        <Route path="/report" element={<Report />} />
          <Route path="/report/6hour" element={<SixHourReport />} />
          <Route path="/report/8hour" element={<EightHourReport />} />
          <Route path="/report/9hour" element={<NineHourReport />} />
          <Route path="/community_tips" element={<CommunityTips />} />
      </Routes>
    </Router>
  );
}

export default App;
